import React, { Component } from "react";
import SearchItem from "./SearchItem";

const SearchList = ({ results }) => {
  return (
    <div className="search-results">
      <ul>
        {results.map(game => (
          <li>
            <SearchItem game={game}></SearchItem>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SearchList;
